import React from 'react';
import { motion } from 'framer-motion';
import logger from '../../utils/logger';
import animationSystem from '../../utils/animations';

const AnimatedList = ({ 
  children, 
  staggerType = 'container',
  className = '',
  disableMotion = false,
  ...props 
}) => {

  React.useEffect(() => {
    logger.ui('MOUNT', 'AnimatedList', { staggerType, childrenCount: React.Children.count(children) }, 'UI_ANIMATED_LIST');

    return () => {
      logger.ui('UNMOUNT', 'AnimatedList', { staggerType }, 'UI_ANIMATED_LIST');
    };
  }, [staggerType, children]);

  // Get stagger animation configuration
  const staggerConfig = disableMotion ? {} : animationSystem.getAnimation('staggerAnimations', staggerType);
  const reducedMotionAnimation = disableMotion ? {} : animationSystem.getReducedMotionAnimation(staggerConfig);

  logger.debug(`AnimatedList rendered with staggerType: ${staggerType}, children: ${React.Children.count(children)}`, 'UI_ANIMATED_LIST');

  return (
    <motion.div
      className={className}
      variants={disableMotion ? undefined : reducedMotionAnimation}
      initial={disableMotion ? undefined : 'hidden'}
      animate={disableMotion ? undefined : 'visible'}
      onAnimationStart={disableMotion ? undefined : () => logger.ui('ANIMATION_START', 'AnimatedList', { staggerType }, 'UI_ANIMATED_LIST')}
      onAnimationComplete={disableMotion ? undefined : () => logger.ui('ANIMATION_COMPLETE', 'AnimatedList', { staggerType }, 'UI_ANIMATED_LIST')}
      {...props}
    >
      {children}
    </motion.div>
  );
};

// Animated list item component
export const AnimatedListItem = ({ 
  children, 
  staggerType = 'item',
  className = '',
  disableMotion = false,
  ...props 
}) => {

  // Get item animation configuration
  const itemConfig = disableMotion ? {} : animationSystem.getAnimation('staggerAnimations', staggerType);
  const reducedMotionAnimation = disableMotion ? {} : animationSystem.getReducedMotionAnimation(itemConfig);

  logger.debug(`AnimatedListItem rendered with staggerType: ${staggerType}`, 'UI_ANIMATED_LIST');

  return (
    <motion.div
      className={className}
      variants={disableMotion ? undefined : reducedMotionAnimation}
      onAnimationStart={disableMotion ? undefined : () => logger.ui('ANIMATION_START', 'AnimatedListItem', { staggerType }, 'UI_ANIMATED_LIST')}
      {...props}
    >
      {children}
    </motion.div>
  );
};

// Grid animation component
export const AnimatedGrid = ({ 
  children, 
  columns = 3,
  gap = 4,
  staggerType = 'fastStagger',
  className = '',
  disableMotion = false,
  ...props 
}) => {

  React.useEffect(() => {
    logger.ui('MOUNT', 'AnimatedGrid', { columns, gap, staggerType, childrenCount: React.Children.count(children) }, 'UI_ANIMATED_GRID');
  }, [columns, gap, staggerType, children]);

  const gridClasses = `grid grid-cols-1 md:grid-cols-${columns} gap-${gap} ${className}`;

  // Get stagger animation configuration
  const staggerConfig = disableMotion ? {} : animationSystem.getAnimation('staggerAnimations', staggerType);
  const reducedMotionAnimation = disableMotion ? {} : animationSystem.getReducedMotionAnimation(staggerConfig);

  return (
    <motion.div
      className={gridClasses}
      variants={disableMotion ? undefined : reducedMotionAnimation.container}
      initial={disableMotion ? undefined : 'hidden'}
      animate={disableMotion ? undefined : 'visible'}
      onAnimationStart={disableMotion ? undefined : () => logger.ui('ANIMATION_START', 'AnimatedGrid', { staggerType }, 'UI_ANIMATED_GRID')}
      onAnimationComplete={disableMotion ? undefined : () => logger.ui('ANIMATION_COMPLETE', 'AnimatedGrid', { staggerType }, 'UI_ANIMATED_GRID')}
      {...props}
    >
      {React.Children.map(children, (child, index) => (
        <motion.div
          key={index}
          variants={disableMotion ? undefined : reducedMotionAnimation.item}
          onAnimationStart={disableMotion ? undefined : () => logger.ui('ANIMATION_START', 'AnimatedGridItem', { index }, 'UI_ANIMATED_GRID')}
        >
          {child}
        </motion.div>
      ))}
    </motion.div>
  );
};

// Fade in when visible component
export const FadeInWhenVisible = ({ 
  children, 
  animationType = 'slideUp',
  threshold = 0.1,
  className = '',
  disableMotion = false,
  ...props 
}) => {

  React.useEffect(() => {
    logger.ui('MOUNT', 'FadeInWhenVisible', { animationType, threshold }, 'UI_FADE_IN_VISIBLE');
  }, [animationType, threshold]);

  // Get animation configuration
  const animation = disableMotion ? {} : animationSystem.getAnimation('pageTransitions', animationType);
  const reducedMotionAnimation = disableMotion ? {} : animationSystem.getReducedMotionAnimation(animation);

  return (
    <motion.div
      className={className}
      initial={disableMotion ? undefined : reducedMotionAnimation.initial}
      whileInView={disableMotion ? undefined : reducedMotionAnimation.animate}
      viewport={disableMotion ? undefined : { once: true, amount: threshold }}
      transition={disableMotion ? undefined : reducedMotionAnimation.transition}
      onAnimationStart={disableMotion ? undefined : () => logger.ui('ANIMATION_START', 'FadeInWhenVisible', { animationType }, 'UI_FADE_IN_VISIBLE')}
      onAnimationComplete={disableMotion ? undefined : () => logger.ui('ANIMATION_COMPLETE', 'FadeInWhenVisible', { animationType }, 'UI_FADE_IN_VISIBLE')}
      {...props}
    >
      {children}
    </motion.div>
  );
};

export default AnimatedList;
